l_english:
 ag_exe_invasion_chain_title:0 "§EEternal Fleet§!"
 ag_exe_invasion_chain_desc:0 "These invaders from extragalactic systems don't seem to communicate with us, they just destroy everything they encounter until they themselves are destroyed."
 ag_exe_invasion_fleet:0 "§YEternal Fleet§!"
 ag_exe_invasion_planet_destroyed:0 "§YA world destroyed by the Eternal Fleet§!"
 ag_exe_invasion_ship_kill_by_us:0 "§GThe Eternal Fleet we destroyed§!"
 ag_exe_invasion_ship_kill_by_other:0 "§GEternal fleet destroyed by others§!"
 ag_exe_invasion_victim:0 "§RShips destroyed by the Eternal Fleet§!"
 exe_invasion_lock_outer_gate: "close stargate"
 exe_invasion_lock_outer_gate_DESC: "We can close the stargates within our borders to increase our preparation time."
 exe_invasion_lock_the_eclipse: "Eternal flagship"
 exe_invasion_lock_the_eclipse_DESC: "The super flagship from the Eternal Fleet, we need to further study and analyze its composition, but this flagship design that resembles the Kuat Shipyard seems to have an unknown secret............. ..."
 ag_shattered_holy_planet:0 "once holy place"
 ag_shattered_holy_planet_desc:0 "The planet was once considered a sacred site by a lost empire, but now all that remains are countless wrecks floating in orbit. No matter what kind of wealth it once possessed, it had long been wiped out in previous disasters."
 ag_shattered_holy_planet_custom:0 "This planet was once considered a sacred place by a lost empire before it was shattered."
 exe_outer_gate_locked: "$exe_outer_gate$"
 exe_outer_gate_locked_DESC: "A strange stargate, it has been locked by us."
 exe_outer_gate_disable: "$exe_outer_gate$"
 exe_outer_gate_disable_MEGASTRUCTURE_DETAILS: "$exe_outer_gate_disable_DESC$"
 exe_outer_gate_disable_DESC: "A strange stargate, it's locked."
 bombardment_exe_invasion_bombardment:0 "eternal bombing"
 bombardment_exe_invasion_bombardment_desc:0 "The orbital bombardment weapons carried by the Eternal Fleet battleships can cause huge damage to planets. \n-Causes §RInsane§! damage to §YArmy§!. \n-Causes §RInsane§! damage to §YPlanet§!. \n-Causes §RInsane§! damage to §YPop§!. \n-Will bomb undefended planets. \n-When the planet destruction degree reaches §R100§! or £pop£§YAll pop§! and the number §Rdoes not exceed 1§! will cause the planet to be §RInsane§!."
 sc_kuat:1 "Fringe Star Territory"
 sc_kuat_desc:1 "These are planetary systems around a star located in a star field that we cannot yet accurately observe. These planetary systems constitute the main environment and star field structure of this star field."
 cannot_sold_kuat_fleet:0 "This fleet cannot be sold, transferred, or converted into a mercenary city-state."
